function List(props){
    const {data} = props;
    console.log(props)
    const List=data.map((e)=>{
      return(
        <li>{e.name},{props.branch}</li>
      )  
    })
    return(
      
        <ul>
          {List}
        </ul>
     
    )
  }
  export default List;
